import Expcard from "./Expcard";

import Expdata from "./Expdata";


import pic1 from '../images/arrowleft.png'
import pic2 from '../images/arrowright.png'
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
function SampleNextArrow(props) {
  const { className, style, onClick } = props;
  return (

    <img src={pic2}   className={className}
    style={{ ...style, display: "block",  }}
    onClick={onClick}   />
  );
}

function SamplePrevArrow(props) {
  const { className, style, onClick } = props;
  return (
    <img src={pic1}   className={className}
    style={{ ...style, display: "block",  }}
    onClick={onClick}   />


  );
}




function Experience() {
  const settings = {
    dots: true,
    infinite: true,
    slidesToShow: 3,
    slidesToScroll: 1,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />
  };

  return (
    <>
    <div className="container Experience">

    <h1 className="text-center heading mt-5">Experience</h1>



      <Slider {...settings}>
        <div>
          <h3>1</h3>

        </div>
        <div>
          <h3>2</h3>
        </div>
        <div>
          <h3>3</h3>
        </div>
        <div>
          <h3>4</h3>
        </div>
        <div>
          <h3>5</h3>
        </div>
        <div>
          <h3>6</h3>
        </div>
      </Slider>



     {
      Expdata.map((val,ind)=>{
       return

       <Expcard key={ind} date={val.date} title={val.title} para={val.para} />


      })
     }




    </div>





  </>);
}

export default Experience;
